import React from 'react'
import './Main.css'
import mainImg from '../Utilities/logo.jpg'

export default function Main() {
  return (
    <div >
        {/* 1st section of website */}
    <div className='main1'>

        <p class="fs-1 fw-bold font-monospace mt-4" className=''>
            welcome to main page...
        </p>

        <button>Report the issue</button>
        
        <img src={mainImg} alt='main page element' className='mainImage'></img>

    </div>
        {/* 1st section o website end */}
        
        {/* 2nd section of website */}
    <div className='main2'>

    <hr></hr>


    </div>
  
    </div>
  )
}
